//setPos0-setPos4 function are for setting each row position based on the width of each row	
function setPos0() {	
	let val=0;
	let newx=0;
	var totalv =0;
	
	for (let j=1; j<=header_gtags0.length; j++) {		
				const headrecbox = header_rects0[j-1].getBBox();
				const prevheadrecbox = header_rects0[j-1].getBBox(); //how is this working? both headrecbox and prevheadrecbox will be same,right?				
				
				newx = headrecbox.x+headrecbox.width + 51;
				val = val+newx-(prevheadrecbox.x);
				if(j<header_gtags0.length){
					header_gtags0[j].setAttributeNS(null, "transform", `translate(${val}, 0)`);
				}		
								
				totalv = totalv+headrecbox.width+45;
				
			}
	newval=(header.width-totalv)/2;	
	
