//automatic wrapping of long string of text in del titles. First get all tspans from all 3 columns. Then write function to add a new tspan everytime the text is too long
const tspans = document.getElementById("col1").getElementsByTagName("tspan");
const tspans1 = document.getElementById("col2").getElementsByTagName("tspan");
const tspans2 = document.getElementById("col3").getElementsByTagName("tspan"); 

function wrapTextInTspans() {
  const maxWidth = 550;
  
  for (let i = 0; i < tspans.length; i++) {
    const tspan = tspans[i];
    const words = tspan.textContent.trim().split(' ');
    let line = '';
    let currentTspan = tspan;
    let newTspan;
	
    for (let j = 0; j < words.length; j++) {
      const testLine = line + words[j] + ' ';
      const metrics = currentTspan.getSubStringLength(0, testLine.length);
	  
      if (metrics > maxWidth && j > 0) {
        newTspan = document.createElementNS("http://www.w3.org/2000/svg", "tspan");
        newTspan.setAttributeNS(null, "x", 0);
        newTspan.setAttributeNS(null, "dy", 25);
        newTspan.classList.add("st12", "st13");
        newTspan.textContent = words.slice(j).join(' ');
        currentTspan.textContent = line.trim();
        currentTspan.parentNode.insertBefore(newTspan, currentTspan.nextSibling);
        break; // No need to continue processing words for this tspan
      } else {
        line = testLine;
      }
    }
  }
}
