//set the height based on the amount of text and relative positioning of each box
const texttags = document.getElementById("col1").getElementsByTagName("text");
const rectags = document.getElementById("col1").getElementsByTagName("rect");
const gtags = document.getElementById("col1").getElementsByTagName("g");

const texttags1 = document.getElementById("col2").getElementsByTagName("text");
const rectags1 = document.getElementById("col2").getElementsByTagName("rect");
const gtags1 = document.getElementById("col2").getElementsByTagName("g");

const texttags2 = document.getElementById("col3").getElementsByTagName("text");
const rectags2 = document.getElementById("col3").getElementsByTagName("rect");
const gtags2 = document.getElementById("col3").getElementsByTagName("g");


function setHeight() {
//set height based on the amount of text
	
	for (let i=0; i<rectags.length; i++) {
		if(rectags[i].id!=""){
			
			const textbox = texttags[i].getBBox();
			rectags[i].setAttributeNS(null, "height",210 + textbox.height);
			rectags[i+1].setAttributeNS(null, "height", textbox.height);
			
		}
	}
	
//set postition of each box relative to the other boxes in the same column	

	const baseH = ["1333", "1093", "883", "413", "653"];
	let offsetVal = 0;
	
	for (let i=1; i<gtags.length; i++) {	
			
			const currH = gtags[i-1].getBBox().height;			
			
			offsetVal = offsetVal+(currH - baseH[i-1]);				
						
			for (let j=i; j<gtags.length; j++) {
				
				gtags[j].setAttributeNS(null, "transform", `translate(0, ${offsetVal})`);
			}			
							
	}
}

function setHeight1() {
//set height based on the amount of text

	for (let i=0; i<rectags1.length; i++) {
		if(rectags1[i].id!=""){
			const textbox1 = texttags1[i].getBBox();
			rectags1[i].setAttributeNS(null, "height",210 + textbox1.height);
			rectags1[i+1].setAttributeNS(null, "height", textbox1.height);
			
		}
	}

//set postition of each box relative to the other boxes in the same column	
	const baseH1 = ["853", "573", "591", "773", "391", "404", "1046"];
	let offsetVal1 = 0;
	
	for (let i=1; i<gtags1.length; i++) {	
			
			const currH1 = gtags1[i-1].getBBox().height;			
			
			offsetVal1 = offsetVal1+(currH1 - baseH1[i-1]);				
						
			for (let j=i; j<gtags1.length; j++) {
				gtags1[j].setAttributeNS(null, "transform", `translate(0, ${offsetVal1})`);
			}			
							
	}
}

function setHeight2() {	

	for (let i=0; i<rectags2.length; i++) {
	
		if(rectags2[i].id!=""){
			const textbox2 = texttags2[i].getBBox();
			rectags2[i].setAttributeNS(null, "height",210 + textbox2.height);
			rectags2[i+1].setAttributeNS(null, "height", textbox2.height);			
		}
	}

//set postition of each box relative to the other boxes in the same column	
	const baseH2 = ["363", "813", "373", "963", "573", "483", "573"];
	let offsetVal2 = 0;
	
	for (let i=1; i<gtags2.length; i++) {	
			
			const currH2 = gtags2[i-1].getBBox().height;			
			
			offsetVal2 = offsetVal2+(currH2 - baseH2[i-1]);				
						
			for (let j=i; j<gtags2.length; j++) {
				gtags2[j].setAttributeNS(null, "transform", `translate(0, ${offsetVal2})`);
			}			
							
	}

}


